import React from 'react';
import requireAuth from 'app/views/components/middleware/RequireAuth';
import requireAdminAuth from 'app/views/components/middleware/RequireAdminAuth';
// Component for
// Lazy load Components
const LandingPage = React.lazy(() => import('app/views/pages/LandingPage'));
const ErrorsPage = React.lazy(() => import('app/views/pages/ErrorsPage'));
const LogoutPage = React.lazy(() => import('app/views/pages/LogoutPage'));
// Auth
const AuthPage = React.lazy(() => import('app/views/pages/AuthPage/Injectable'));
const ConfirmMailPage = React.lazy(() => import('app/views/pages/ConfirmEmail'));
// Dashboard
const DashboardPage = React.lazy(() => import('app/views/pages/Dashboard'));
const UserManagementPage = React.lazy(() => import('app/views/pages/UsersManagementPage'));
const BlogManagementPage = React.lazy(() => import('../pages/BlogManagementPage'));

// TEST
const Result = React.lazy(() => import('app/views/pages/Test/Result/Injectable'));
const ReadingTest = React.lazy(() => import('app/views/pages/Test/ReadingTest/Injectable'));
const TestDetails = React.lazy(() => import('app/views/pages/TestDetails/Injectable'));
const TestCollectionPage = React.lazy(() => import('app/views/pages/Test/Collection/Injectable'));
// USER
const UserProfile = React.lazy(() => import('app/views/pages/UserProfile'));
// BLOG
const Blog = React.lazy(() => import('app/views/pages/Blog'));

// Routes
const routesConfig = [
	// Is not affected by layout
	{
		path: '/',
		hasLayout: true,
		exact: true,
		name: 'Landing Page',
		hasLayout: false,
		hasFooter: true,
		hasHeader: true,
		component: LandingPage,
	},
	{ path: '/auth', exact: false, hasLayout: false, name: 'Auth Page', component: AuthPage },
	{
		path: '/email/verify/:emailToken',
		exact: false,
		hasLayout: false,
		name: 'Auth Page',
		component: ConfirmMailPage,
	},
	{ path: '/logout', exact: true, hasLayout: false, name: 'Logout Page', component: LogoutPage },
	{
		path: '/400',
		extraProps: { code: '400' },
		exact: true,
		hasLayout: false,
		hasFooter: false,
		hasHeader: false,
		name: '400 Page',
		component: ErrorsPage,
	},
	{
		path: '/401',
		extraProps: { code: '401' },
		exact: true,
		hasLayout: false,
		hasFooter: false,
		hasHeader: false,
		name: '401 Page',
		component: ErrorsPage,
	},
	{
		path: '/403',
		extraProps: { code: '403' },
		exact: true,
		hasLayout: false,
		hasFooter: false,
		hasHeader: false,
		name: '404 Page',
		component: ErrorsPage,
	},
	{
		path: '/404',
		extraProps: { code: '404' },
		exact: true,
		hasLayout: false,
		hasFooter: false,
		hasHeader: false,
		name: '404 Page',
		component: ErrorsPage,
	},
	{
		path: '/500',
		exact: true,
		extraProps: { code: '500' },
		hasLayout: false,
		hasHeader: false,
		hasFooter: false,
		name: '500 Page',
		component: ErrorsPage,
	},
	// Affected by layout
	{
		path: '/dashboard',
		hasLayout: true,
		exact: true,
		name: 'Dashboard',
		component: requireAdminAuth(DashboardPage),
	},
	{
		path: '/admin/users',
		hasLayout: true,
		exact: true,
		name: 'User Management',
		component: requireAdminAuth(UserManagementPage),
	},
	{
		path: '/admin/blogs',
		hasLayout: true,
		exact: true,
		name: 'Blog Management',
		component: requireAdminAuth(BlogManagementPage),
	},
	{
		path: '/test/:testId',
		hasLayout: true,
		hasHeader: true,
		hasFooter: true,
		exact: true,
		name: 'Test Details',
		component: TestDetails,
	},
	{
		path: '/test/:testId/reading',
		hasLayout: false,
		hasHeader: true,
		hasFooter: false,
		exact: true,
		name: 'Reading Test',
		component: requireAuth(ReadingTest),
	},
	{
		path: '/collection',
		hasLayout: true,
		exact: true,
		name: 'Test collection',
		component: TestCollectionPage,
	},

	{
		path: '/result/reading/:resultId',
		hasLayout: true,
		exact: true,
		name: 'Reading Result',
		component: Result,
	},
	{
		path: '/user/:userId',
		hasLayout: true,
		hasHeader: true,
		exact: true,
		name: 'User Profile',
		component: UserProfile,
	},
	{
		path: '/blog/:id',
		hasLayout: true,
		hasHeader: true,
		hasFooter: true,
		exact: true,
		name: 'Blog',
		component: Blog,
	},
];

export default routesConfig;
